
public class Multiplication {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int i,j,n=9,mul;
        for(i=1;i<=n;i++)
        {
        	for(j=1;j<=n;j++)
        	{
        		mul=i*j;
        		System.out.println("multiplication of "+i+"*"+j+" is:"+mul);
        	}
        }
	}

}
